from aiogram import typesfrom aiogram.types import InlineKeyboardButton, InlineKeyboardMarkup, ReplyKeyboardMarkup, KeyboardButtonkb = [    [types.KeyboardButton(text="Foxtrot")],    [types.KeyboardButton(text="Moyo")],    [types.KeyboardButton(text="KTC")],    [types.KeyboardButton(text="Click")],    [types.KeyboardButton(text="Rozetka")],    [types.KeyboardButton(text="Auchan")],    [types.KeyboardButton(text="WO")],]def get_custom_keyboard():    buttons = [        [KeyboardButton(text="Foxtrot"), KeyboardButton(text="Moyo"), KeyboardButton(text="KTC")],        [KeyboardButton(text="Click"), KeyboardButton(text="Rozetka"), KeyboardButton(text="Auchan")],        [KeyboardButton(text='WO')]    ]    keyboard = ReplyKeyboardMarkup(keyboard=buttons, resize_keyboard=True)    return keyboard